  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Central Region Energy Team assesses
  oil and gas resources of the United States. The onshore and State water areas of
  the United States comprise 71 provinces. Within these provinces, Total Petroleum
  Systems are defined and Assessment Units are defined and assessed. Each of these
  provinces is defined geologically, and most province boundaries are defined by major
  geologic changes. The Wyoming Thrust Belt Province is located in southeastern Idaho,
  north central Utah, and southwestern Wyoming, encompassing all or parts of Bannock,
  Bear Lake, Bingham, Bonneville, Caribou, Franklin, Jefferson, Madison, and Teton
  Counties in Idaho and all or parts of Box Elder, Cache, Davis, Morgan, Rich, Salt
  Lake, Summit, and Weber Counties in Utah and all or parts of Lincoln, Sublette,
  Teton, and Uinta Counties in Wyoming. The main population centers within the study
  area are Soda Springs and Montpelier, Idaho; and Morgan and Coalville, Utah; and
  Evanston and Kemmerer Wyoming. The main highways, I-80 and U.S. 30, generally traverse
  the area from east to west with U.S. Route 89 running north to south. The Snake
  River and its tributaries drain the area. The province boundary was drawn to include
  the geologic structures generally considered to be in or bounding the Wyoming Thrust
  Belt Province.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
